import gql from 'graphql-tag';

export const ALL_CHARACTERS = gql`
    query{
        characters{
            results{
                id
                name
                image
                status
            }
        }
    }
`;

export const GET_CHARECTER = gql`
    query Character($id: ID!){
        Character

    }
`;
